import axios from "axios";

function App() {
    const [data,setdata]=useState("");
    const getdata =()=>
    {
        const res=axios.get("http://localhost:8080/connect");
        setdata(res.data);
    }
    useEffect(()=>{
        getdata();
    })
    return(
        <>
        <div>
            {/* <DefaultPage>
